♻️✨ GEMPITA Warga Medansatria ✨♻️
Minyak jelantah bukan sekadar limbah, tapi punya nilai ekonomi dan manfaat besar bagi lingkungan 🌱

Melalui Gerakan Masyarakat Penyaluran Minyak Jelanta (GEMPITA), warga diajak untuk :
1️⃣ Memisahkan & mengumpulkan minyak jelantah di rumah tangga.
